"use strict";(self.webpackChunkapi_dokumentasjon=self.webpackChunkapi_dokumentasjon||[]).push([[2386],{7494:e=>{e.exports=JSON.parse('{"label":"API","permalink":"/api-dokumentasjon/tags/api","allTagsPath":"/api-dokumentasjon/tags","count":36,"items":[{"id":"api/aktivkonto","title":"Aktiv konto API","description":"Tjenesten leverer informasjon om valgt konto for utbetalinger fra det offentlige for en person eller virksomhet.","permalink":"/api-dokumentasjon/api/aktivkonto"},{"id":"api/arbeidsforhold","title":"Arbeidsforhold API","description":"Tjenesten leverer informasjon om hvorvidt det foreligger et aktivt arbeidsforhold mellom angitt arbeidstaker og angitt arbeidsgiver.","permalink":"/api-dokumentasjon/api/arbeidsforhold"},{"id":"api/arbeidsgiveravgift","title":"Arbeidsgiveravgift API","description":"Tjenesten leverer informasjon om en virksomhet sitt grunnlag for arbeidsgiveravgift pr. 2 m\xe5neds termin for de siste tre terminer.","permalink":"/api-dokumentasjon/api/arbeidsgiveravgift"},{"id":"api/avregning","title":"Avregning API","description":"Tjenesten leverer informasjon om forskuddstrekk og restskatt eller bel\xf8p til gode i skatteoppgj\xf8ret.","permalink":"/api-dokumentasjon/api/avregning"},{"id":"api/beregnetskatt","title":"Beregnet skatt API","description":"Tjenesten leverer informasjon om inntekt, fradrag, formue, gjeld og beregnet skatt.","permalink":"/api-dokumentasjon/api/beregnetskatt"},{"id":"api/beregnetskattupersonlig","title":"Beregnet skatt upersonlig API","description":"Tjenesten leverer informasjon om inntekt, fradrag, formue, gjeld og beregnet skatt for en virksomhet.","permalink":"/api-dokumentasjon/api/beregnetskattupersonlig"},{"id":"api/bsu","title":"Boligsparing for ungdom API","description":"Tjenesten leverer informasjon om BSU renteinntekter pr kalender\xe5r for en person.","permalink":"/api-dokumentasjon/api/bsu"},{"id":"om/bruk","title":"Bruk av tjenestene","description":"Overordnet om Skatteetatens tjenester.","permalink":"/api-dokumentasjon/om/bruk"},{"id":"api/hendelser","title":"Hendelser","description":"Tjenestene leverer l\xf8pende varslinger om personer/virksomheter med nye eller endrede opplysninger tilgjengelig.","permalink":"/api-dokumentasjon/api/hendelser"},{"id":"api/inntekt","title":"Inntekt API","description":"Tjenesten leverer informasjon om arbeidsgivers (opplysningspliktiges) innrapporterte inntektsopplysninger for en inntektsmottaker for en gitt periode.","permalink":"/api-dokumentasjon/api/inntekt"},{"id":"api/inntektsmottakere","title":"Inntektsmottakere API","description":"Tjenesten leverer en liste over inntektsmottakere der arbeidsgiver (opplysningspliktig), via a-ordningen, har rapportert pensjonsavtale med pensjonsinnretningen som utf\xf8rer kallet.","permalink":"/api-dokumentasjon/api/inntektsmottakere"},{"id":"komigang","title":"Kom i gang","description":"Skatteetaten tilbyr en rekke standardiserte maskin-til-maskin-tjenester som kan benyttes av norske offentlige eller private virksomheter som har behov for  tilgang til opplysninger fra Skatteetaten. Dokumentasjon av disse delingstjenestene er samlet p\xe5 denne nettsiden. Vi jobber fortl\xf8pende med \xe5 tilgjengeliggj\xf8re flere delingstjenester.","permalink":"/api-dokumentasjon/"},{"id":"api/kravogbetalinger","title":"Krav og betalinger API","description":"Tjeneste som tilbyr oversikt av krav, innbetalinger og utbetalinger tilh\xf8rende en part. Denne tjenesten er for tiden kun i beta-versjon, se mer informasjon p\xe5 Skatteetatens beta-Github.","permalink":"/api-dokumentasjon/api/kravogbetalinger"},{"id":"api/mva_meldingsopplysning","title":"Mva meldingsoppslysning API","description":"Tjenesten leverer status p\xe5 mva-melding og informasjon fra reskontro for en virksomhet for de siste tre terminene.","permalink":"/api-dokumentasjon/api/mva_meldingsopplysning"},{"id":"api/mvamelding","title":"Mva-melding API","description":"Tjenesten leverer fastsatte mva-meldinger. Fastsatt betyr at skattemeldingen er myndighetsfastsatt, manuelt innlevert, eller automatisk innlevert ved utl\xf8p av innleveringsfrist.","permalink":"/api-dokumentasjon/api/mvamelding"},{"id":"api/mvaregisteravgiftssubjekt","title":"Mva-register \u2013 avgiftssubjekter med skattemeldingsplikt API","description":"Tjenesten leverer infomasjon fra mva-register om avgiftssubjekter med skatteplikt.","permalink":"/api-dokumentasjon/api/mvaregisteravgiftssubjekt"},{"id":"api/naeringsspesifikasjon","title":"N\xe6ringsspesifikasjon API","description":"Tjenesten leverer n\xe6ringsopplysninger som enkeltpersonforetak og selskaper har innrapportert til Skatteetaten i forbindelse med skattemeldingen.","permalink":"/api-dokumentasjon/api/naeringsspesifikasjon"},{"id":"api/omregistreringsavgift","title":"Omregistreringsavgift API","description":"Tjenesten leverer omregistreringsavgiften for kj\xf8ret\xf8y spesifisert av kjennemerke og eventuelt omregistreringsdato.","permalink":"/api-dokumentasjon/api/omregistreringsavgift"},{"id":"api/oppdragutenlandskevirksomheter","title":"Oppdrag utenlandske virksomheter API","description":"Tjenesten leverer informasjon fra Oppdrags- og arbeidsforholdsregisteret om utenlandske virksomheters oppdrag i Norge.","permalink":"/api-dokumentasjon/api/oppdragutenlandskevirksomheter"},{"id":"api/pgi","title":"Pensjonsgivende inntekt API","description":"Tjenesten leverer skattemyndighetenes beregning av pensjonsgivende inntekt (PGI) for en person.","permalink":"/api-dokumentasjon/api/pgi"},{"id":"api/pgi_folketrygden","title":"Pensjonsgivende inntekt for folketrygden API","description":"Tjenesten leverer informasjon om grunnlag for pensjonsopptjening i folketrygden.","permalink":"/api-dokumentasjon/api/pgi_folketrygden"},{"id":"api/restanser","title":"Restanser API","description":"Tjenesten leverer informasjon om forfalte og ubetalte skatter og avgifter for en virksomhet.","permalink":"/api-dokumentasjon/api/restanser"},{"id":"api/sistetilgjengeligeskatteoppgjoer","title":"Siste tilgjengelige skatteoppgj\xf8r API","description":"Tjenesten leverer informasjon om siste inntekts\xe5r det foreligger skatteoppgj\xf8r p\xe5 for en person.","permalink":"/api-dokumentasjon/api/sistetilgjengeligeskatteoppgjoer"},{"id":"api/skattemelding","title":"Skattemelding API","description":"Tjenesten leverer informasjon som fremkommer i skattemelding for en person.","permalink":"/api-dokumentasjon/api/skattemelding"},{"id":"api/skattemeldingupersonlig","title":"Skattemelding upersonlig API","description":"Tjenesten leverer opplysninger som fremkommer i skattemeldingen for en virksomhet.","permalink":"/api-dokumentasjon/api/skattemeldingupersonlig"},{"id":"api/skatteplikt","title":"Skatteplikt API","description":"Tjenesten leverer informasjon om type skatteplikt og grunnlag for vurdering av skatteplikten for en person.","permalink":"/api-dokumentasjon/api/skatteplikt"},{"id":"api/skattepliktupersonlig","title":"Skatteplikt upersonlig API","description":"Tjenesten leverer en oppsummering av formue, gjeld, inntekt og fradrag for en virksomhet.","permalink":"/api-dokumentasjon/api/skattepliktupersonlig"},{"id":"api/skattepliktig","title":"Skattepliktig API","description":"Tjenesten leverer informasjon om navn og adresse for skattepliktige personer.","permalink":"/api-dokumentasjon/api/skattepliktig"},{"id":"api/spesifisertsummertskattegrunnlag","title":"Spesifisert summert skattegrunnlag API","description":"Tjenesten leverer en oppsummering av formue, gjeld, inntekt og fradrag for en person, inkludert spesifisering av hvilke opplysninger fra skattemeldingen som ligger til grunn.","permalink":"/api-dokumentasjon/api/spesifisertsummertskattegrunnlag"},{"id":"api/summertskattegrunnlag","title":"Summert skattegrunnlag API","description":"Tjenesten leverer en oppsummering av formue, gjeld, inntekt og fradrag for en person.","permalink":"/api-dokumentasjon/api/summertskattegrunnlag"},{"id":"api/summertskattegrunnlagupersonlig","title":"Summert skattegrunnlag upersonlig API","description":"Tjenesten leverer en oppsummering av formue, gjeld, inntekt og fradrag for en virksomhet.","permalink":"/api-dokumentasjon/api/summertskattegrunnlagupersonlig"},{"id":"om/tekniskspesifikasjon","title":"Teknisk spesifikasjon","description":"Skatteetaten benytter Open API spesifikasjon og Swaggerhub for teknisk spesifikasjon av api\'er.","permalink":"/api-dokumentasjon/om/tekniskspesifikasjon"},{"id":"api/tilleggsskatt","title":"Tilleggsskatt API","description":"Tjenesten leverer informasjon om ilagt tilleggsskatt ved uriktig, eller manglende innlevering av skattemelding.","permalink":"/api-dokumentasjon/api/tilleggsskatt"},{"id":"api/tjenestepensjonsavtale","title":"Tjenestepensjonsavtale API","description":"Tjeneste hvor pensjonsinnretninger kan registrere, oppdatere og slette opplysninger om pensjonsavtaleforhold. Tjenesten kan ogs\xe5 levere informasjon om det foreligger gyldig avtaleforhold mellom arbeidsgiver og pensjonsinnretning.","permalink":"/api-dokumentasjon/api/tjenestepensjonsavtale"},{"id":"api/trukketkildeskattpaaloenn","title":"Trukket kildeskatt p\xe5 l\xf8nn API","description":"Tjenesten leverer opplysninger om trukket kildeskatt p\xe5 l\xf8nn for personer i kildeskatt p\xe5 l\xf8nn ordningen.","permalink":"/api-dokumentasjon/api/trukketkildeskattpaaloenn"},{"id":"om/versjoner","title":"Versjoner","description":"Skatteetatens strategi for versjonering.","permalink":"/api-dokumentasjon/om/versjoner"}]}')}}]);